          <Text style={{color:'grey'}}>agora mesmo</Text>
        </View>
      </View>
        ))}
      </ScrollView>
      <ConfigStatusButton />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: StatusBar.currentHeight,
    margin: 10,
  },
  userContainer: {
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "space-between",
  },
  statusContainer: {
    marginTop: 10,
  },
  rowContainer: {
    flexDirection: "row",
    alignItems: "center",
  },
  blueButton: {
    ṕadding: 10,
    borderRadius: 100,
    backgroundColor: "#2f95dc",
    width: 35,
    height: 35,
    alignItems: "center",
    justifyContent: "center",
    marginRight: 5,
  },
  searchContainer: {
    borderBottomWidth: 1,
    padding: 10,
    margintop: 10,
  },
  searchInput: {
    borderRadius: 10,
    width: "100%",
    height: 30,
    padding: 10,
  },
  statusBlock: {
    flexDirection: "row",
    alignItems: "center",
    marginBottom: 5,
  },
  statusPic: {
    padding: 5,
    marginRight: 10,
    borderRadius: 100,
    backgroundColor: "red",
    width: 50,
    height: 50,
  },
  sttsLine: {
    backgroundColor: "#2f95dc",
    width: 5,
    height: 5,
  },
  outerCircle: {
    position: "absolute",
    justifyContent: "center",
    alignItems: "center",
    width: 42,
    height: 42,
    borderRadius: 21,
  },
  innerCircle: {
    overflow: "hidden",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#fff",
    width: 34,
    height: 34,
    borderRadius: 17,
  },
  leftWrap: {
    position: "absolute",
    top: 0,
    left: 0,
    width: 21,
    height: 42,
  },
  halfCircle: {
    position: "absolute",
    top: 0,
    left: 0,
    borderTopRightRadius: 0,
